const anunciosDummy = [
    {
        id: 1,
        imgSrc: ["data:image/jpeg;base64,"],
        productoNombre: "Flor roja",
        comercio: "Floreria Bob",
        comercioId: 1,
        categoria: "Botanica",
        descripcion: "Anuncio disponible en la region",
        disponible: true
    },
]

var anuncios = JSON.parse(sessionStorage.getItem("anuncios"));
